There are a few annotations that are useful to help rustdoc do the right thing when testing your code: /// ```ignore
/// fn foo() {
/// ```
# fn foo() {} The ignore directive tells Rust to ignore your code. This is almost never what you want, as it's the most generic. Instead, consider annotating it with text if it's not code, or using #s to get a working example that only shows the part you care about. /// ```should_panic
/// assert!(false);
/// ```
# fn foo() {} should_panic tells rustdoc that the code should compile correctly, but not actually pass as a test. /// ```no_run
/// loop {
/// println!("Hello, world");
/// }
/// ```
# fn foo() {} The no_run attribute will compile your code, but not run it. This is important for examples such as "Here's how to retrieve a web page," which you would want to ensure compiles, but might be run in a test environment that has no network access. /// ```compile_fail
/// let x = 5;
/// x += 2; // shouldn't compile!
/// ``` compile_fail tells rustdoc that the compilation should fail. If it compiles, then the test will fail. However please note that code failing with the current Rust release may work in a future release, as new features are added. /// Only runs on the 2018 edition.
///
/// ```edition2018
/// let result: Result<i32, ParseIntError> = try {
/// "1".parse::<i32>()?
/// + "2".parse::<i32>()?
/// + "3".parse::<i32>()?
/// };
/// ``` edition2018 tells rustdoc that the code sample should be compiled the 2018 edition of Rust. Similarly, you can specify edition2015 to compile the code with the 2015 edition.

