As designed in RFC 1946 , Rustdoc can parse paths to items when you use them as links. To resolve these type names, it uses the items currently in-scope, either by declaration or by use statement. For modules, the "active scope" depends on whether the documentation is written outside the module (as /// comments on the mod statement) or inside the module (at //! comments inside the file or block). For all other items, it uses the enclosing module's scope. For example, in the following code: /// Does the thing.
pub fn do_the_thing(_: SomeType) { println!("Let's do the thing!");
} /// Token you use to [`do_the_thing`].
pub struct SomeType; The link to [`do_the_thing`] in SomeType's docs will properly link to the page for fn do_the_thing. Note that here, rustdoc will insert the link target for you, but manually writing the target out also works: pub mod some_module { /// Token you use to do the thing. pub struct SomeStruct;
} /// Does the thing. Requires one [`SomeStruct`] for the thing to work.
///
/// [`SomeStruct`]: some_module::SomeStruct
pub fn do_the_thing(_: some_module::SomeStruct) { println!("Let's do the thing!");
} For more details, check out the RFC , and see the tracking issue for more information about what parts of the feature are available.

