Using this flag looks like this: $ rustdoc src/lib.rs -Z unstable-options --enable-per-target-ignores This flag allows you to tag doctests with compiltest style ignore-foo filters that prevent rustdoc from running that test if the target triple string contains foo. For example: ///```ignore-foo,ignore-bar
///assert!(2 == 2);
///```
struct Foo; This will not be run when the build target is super-awesome-foo or less-bar-awesome. If the flag is not enabled, then rustdoc will consume the filter, but do nothing with it, and the above example will be run for all targets. If you want to preserve backwards compatibility for older versions of rustdoc, you can use ///```ignore,ignore-foo
///assert!(2 == 2);
///```
struct Foo; In older versions, this will be ignored on all targets, but on newer versions ignore-gnu will override ignore.
